INSERT INTO survival_tips (id, category, tip, priority) VALUES (500, 'Shelter', 'The Debris Hut: Create a ridge pole, lean branches against it, cover with 2-3 feet of leaves.', 1);
INSERT INTO survival_tips (id, category, tip, priority) VALUES (501, 'Water', 'Solar Still: Dig a hole, place container in center, cover with plastic, weight center to create a cone.', 1);
INSERT INTO survival_tips (id, category, tip, priority) VALUES (502, 'Fire', 'Bow Drill: Use a spindle, fire board, hand socket, and bow to create friction coal in punk wood.', 1);
INSERT INTO survival_tips (id, category, tip, priority) VALUES (503, 'Medical', 'Natural Antiseptic: Pine resin can be applied to cuts to seal them and prevent infection.', 2);
INSERT INTO survival_tips (id, category, tip, priority) VALUES (504, 'Signal', 'Ground-to-Air: Create a large "V" (Require Assistance) or "X" (Require Medical) on open ground.', 1);
